@acemarke this is why I avoid suspense for data fetching. 

IMO it‚Äôs easier to just use a custom component for loading states that doesn‚Äôt use suspense API because parallel fetches aren‚Äôt clunky.

Very easy to footgun with react query + suspense, for example

@acemarke useQueries can do it:

useQueries({
queries: [aQuery, bQuery]
})

Where aQuery has suspense:true and bQuery has suspense:false. They will fire off in parallel but only suspend until a has finished.

